var title_f39_19_40252="Methods of genetic testing";
var content_f39_19_40252=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F63290&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F63290&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Methods of genetic testing",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       DNA-based",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Direct DNA Testing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Looks for known mutation that causes a condition; requires that the indicated mutation can be identified by testing.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Linkage Testing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       When the conditions for direct DNA testing are not met, linkage testing can infer the presence of a mutation through the study of several family members to identify DNA markers that are co-inherited with the gene of interest.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Methylation Studies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Analyzes the attachment of methyl groups to the DNA molecule of genes in disorders in which methylation patterns influence disease.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Protein Trunction Test (PTT)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Identifies shortened protein product when the mutation that acts by this method, resulting in reduced or absent protein function.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Uniparental Disomy (UPD)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Detection of two copies of the same chromosome pair from one parent and none from the other parent that can result in genetic disease.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       X Inactivation Studies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       In general, one of the pair of X-chromosomes is randomly inactivated in each cell and does not reactivate.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       When in certain condition, X-inactivation is non-random, it can be measured and carrier status of women with a history of these disorders can be predicted on this basis.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Cytogenetic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Fluorescence In Situ Hybridization (FISH)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Viewing of a fluorescence-labeled chromosomal probe introduced into the cell nucleus where it attaches to its match within the cell; used to test for missing or additional chromosome material.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Biochemical",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Analyte",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Quantitative analysis of a substance in the body when increased or decreased amounts may be indicative of a genetic disorder.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Enzyme Assay",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       An enzyme assay that quantifies enzyme activity in order to assess genetic disease or carrier status of a specific disease related to this reaction.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Protein Analysis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Analysis of protein structure looking for alteration that may result in a disease state.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Array Genomic Hybridization (aGH)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Quantitative analysis of labeled total genomic DNA to a microarray (DNA chip) to detect submicroscopic deletions and duplications.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from GeneTests (www.genetests.org).",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.genetests.org\">",
"      file://www.genetests.org",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
